import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import BasicExample from './Components/Navbar';
import { BrowserRouter, Route, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <BasicExample/>
      <Routes>
        <Route path='' element/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
